/** Executes the bcmolt_multi_cfg_get API function for the "bal_system" object based on CLI input. */
static bcmos_errno bcmolt_cli_bal_system_cfg_get_multi(
    bcmolt_devid device_id,
    bcmcli_session *session,
    apicli_byte_pool *byte_pool)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_bal_system_multi_cfg *cfg; /* declare main API struct */
    bcmolt_bal_system_key key = {}; /* declare key */
    uint32_t max_msgs; /* declare max number of messages to get */
    bcmolt_filter_flags filter_flags = BCMOLT_FILTER_FLAGS_DISABLE_FILTER;

    apicli_print_start(session, "bcmolt_multi_cfg_get");

    /* Initialize key value to all wildcards. */
    BCMOLT_KEY_SET_TO_WILDCARD(&key);

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "id");
    if (cli_parm != NULL)
    {
        key.id = (bcmolt_bal_system_id)cli_parm->value.unumber;
    }

    /* Set max number of messages from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "max_msgs");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "max_msgs");
    }
    max_msgs = cli_parm->value.unumber;

    /* Set filter invert flag from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "filter_invert");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "filter_invert");
    }
    if (cli_parm->value.number)
    {
        filter_flags |= BCMOLT_FILTER_FLAGS_INVERT_SELECTION;
    }

    /* Initialize the API struct. */
    cfg = BCMOLT_MULTI_CFG_ALLOC(bal_system, key, max_msgs);
    if (cfg == NULL)
    {
        return apicli_err_alloc_fail(session);
    }
    byte_pool->multi_msg = &cfg->hdr.hdr;

    /* Decode API parameters from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "config_state");
    if (cli_parm != NULL)
    {
        bcmos_bool config_state;
        config_state = cli_parm->value.number;
        if (config_state)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, bal_system_cfg_data, config_state);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "lag_parms");
    if (cli_parm != NULL)
    {
        bcmolt_lag_global_parms lag_parms = {};
        bcmcli_cmd_parm *lag_parms_parm = cli_parm;
        cli_parm = apicli_find_struct_field(&lag_parms_parm->value, "polynomial");
        if (cli_parm != NULL)
        {
            bcmos_bool lag_parms_polynomial;
            lag_parms_polynomial = cli_parm->value.number;
            if (lag_parms_polynomial)
            {
                BCMOLT_FIELD_SET_PRESENT(&lag_parms, lag_global_parms, polynomial);
            }
        }

        cli_parm = apicli_find_struct_field(&lag_parms_parm->value, "hash_field");
        if (cli_parm != NULL)
        {
            bcmos_bool lag_parms_hash_field;
            lag_parms_hash_field = cli_parm->value.number;
            if (lag_parms_hash_field)
            {
                BCMOLT_FIELD_SET_PRESENT(&lag_parms, lag_global_parms, hash_field);
            }
        }

        BCMOLT_FIELD_SET(&cfg->request, bal_system_cfg_data, lag_parms, lag_parms);
    }

    /* Decode filter fields from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "filter");
    if (cli_parm != NULL)
    {
        bcmolt_bal_system_cfg_data filter = {};
        bcmcli_cmd_parm *filter_parm = cli_parm;
        cli_parm = apicli_find_struct_field(&filter_parm->value, "config_state");
        if (cli_parm != NULL)
        {
            bcmolt_config_state filter_config_state;
            filter_config_state = (bcmolt_config_state)cli_parm->value.enum_val;
            BCMOLT_FIELD_SET(&filter, bal_system_cfg_data, config_state, filter_config_state);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "lag_parms");
        if (cli_parm != NULL)
        {
            bcmolt_lag_global_parms filter_lag_parms = {};
            bcmcli_cmd_parm *filter_lag_parms_parm = cli_parm;
            cli_parm = apicli_find_struct_field(&filter_lag_parms_parm->value, "polynomial");
            if (cli_parm != NULL)
            {
                bcmolt_lag_hash_polynomial filter_lag_parms_polynomial;
                filter_lag_parms_polynomial = (bcmolt_lag_hash_polynomial)cli_parm->value.enum_val;
                BCMOLT_FIELD_SET(&filter_lag_parms, lag_global_parms, polynomial, filter_lag_parms_polynomial);
            }

            cli_parm = apicli_find_struct_field(&filter_lag_parms_parm->value, "hash_field");
            if (cli_parm != NULL)
            {
                bcmolt_lag_hash_field_flags filter_lag_parms_hash_field;
                filter_lag_parms_hash_field = (bcmolt_lag_hash_field_flags)cli_parm->value.enum_val;
                BCMOLT_FIELD_SET(&filter_lag_parms, lag_global_parms, hash_field, filter_lag_parms_hash_field);
            }

            BCMOLT_FIELD_SET(&filter, bal_system_cfg_data, lag_parms, filter_lag_parms);
        }

        filter_flags &= ~BCMOLT_FILTER_FLAGS_DISABLE_FILTER;
        cfg->filter = filter;
    }

    /* Call API function. */
    cli_err = bcmolt_multi_cfg_get(device_id, &cfg->hdr, filter_flags);
    apicli_log_example_code(device_id, &cfg->hdr.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &cfg->hdr.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, cfg->hdr.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

