/** Executes the bcmolt_oper_submit API function ('set_mep_state') for the "eth_oam" object based on
  * CLI input. */
static bcmos_errno bcmolt_cli_eth_oam_set_mep_state_submit(
    bcmolt_devid device_id,
    bcmcli_session *session)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_eth_oam_set_mep_state oper; /* declare main API struct */
    bcmolt_eth_oam_key key = {}; /* declare key */

    apicli_print_start(session, "bcmolt_oper_submit");

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "id");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "id");
    }
    else
    {
        key.id = (bcmolt_eth_oam_id)cli_parm->value.unumber;
    }

    /* Initialize the API struct. */
    BCMOLT_OPER_INIT(&oper, eth_oam, set_mep_state, key);

    /* Decode API parameters from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "type");
    if (cli_parm != NULL)
    {
        bcmolt_mep_type type;
        type = (bcmolt_mep_type)cli_parm->value.enum_val;
        BCMOLT_FIELD_SET(&oper.data, eth_oam_set_mep_state_data, type, type);
    }

    cli_parm = bcmcli_find_named_parm(session, "state");
    if (cli_parm != NULL)
    {
        bcmolt_control_state state;
        state = (bcmolt_control_state)cli_parm->value.enum_val;
        BCMOLT_FIELD_SET(&oper.data, eth_oam_set_mep_state_data, state, state);
    }

    /* Call API function. */
    cli_err = bcmolt_oper_submit(device_id, &oper.hdr);
    apicli_log_example_code(device_id, &oper.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &oper.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, oper.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

