            break;

        case BCMOLT_EGRESS_QOS_TYPE_PRIORITY_TO_QUEUE:
            cli_parm = apicli_find_struct_field(&egress_qos_parm->value, "tm_qmp_id");
            if (cli_parm != NULL)
            {
                bcmolt_tm_qmp_id egress_qos_u_priority_to_queue_tm_qmp_id;
                egress_qos_u_priority_to_queue_tm_qmp_id = (bcmolt_tm_qmp_id)cli_parm->value.unumber;
                BCMOLT_FIELD_SET(&egress_qos.u.priority_to_queue, egress_qos_priority_to_queue, tm_qmp_id, egress_qos_u_priority_to_queue_tm_qmp_id);
            }

            cli_parm = apicli_find_struct_field(&egress_qos_parm->value, "tm_q_set_id");
