            {
                bcmolt_tm_queue_set_id egress_qos_u_priority_to_queue_tm_q_set_id;
                egress_qos_u_priority_to_queue_tm_q_set_id = (bcmolt_tm_queue_set_id)cli_parm->value.unumber;
                BCMOLT_FIELD_SET(&egress_qos.u.priority_to_queue, egress_qos_priority_to_queue, tm_q_set_id, egress_qos_u_priority_to_queue_tm_q_set_id);
            }

            break;

        case BCMOLT_EGRESS_QOS_TYPE_NONE:
            break;

        default:
            return apicli_err_param_format(session, egress_qos_parm, "unknown classifier");
