    uint32_t max_msgs; /* declare max number of messages to get */
    bcmolt_filter_flags filter_flags = BCMOLT_FILTER_FLAGS_DISABLE_FILTER;

    apicli_print_start(session, "bcmolt_multi_cfg_get");

    /* Initialize key value to all wildcards. */
    BCMOLT_KEY_SET_TO_WILDCARD(&key);

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "flow_id");
    if (cli_parm != NULL)
    {
        key.flow_id = (bcmolt_flow_id)cli_parm->value.unumber;
    }
    cli_parm = bcmcli_find_named_parm(session, "flow_type");
    if (cli_parm != NULL)
    {
        key.flow_type = (bcmolt_flow_type)cli_parm->value.enum_val;
    }

    /* Set max number of messages from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "max_msgs");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "max_msgs");
    }
    max_msgs = cli_parm->value.unumber;

