        cli_parm = apicli_find_struct_field(&action_parm->value, "o_pbits");
        if (cli_parm != NULL)
        {
            uint8_t action_o_pbits;
            action_o_pbits = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&action, action, o_pbits, action_o_pbits);
        }

        cli_parm = apicli_find_struct_field(&action_parm->value, "i_vid");
        if (cli_parm != NULL)
        {
            uint16_t action_i_vid;
            action_i_vid = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&action, action, i_vid, action_i_vid);
        }

        cli_parm = apicli_find_struct_field(&action_parm->value, "i_pbits");
