/** Executes the bcmolt_multi_cfg_get API function for the "inband_mgmt_channel" object based on CLI
  * input. */
static bcmos_errno bcmolt_cli_inband_mgmt_channel_cfg_get_multi(
    bcmolt_devid device_id,
    bcmcli_session *session,
    apicli_byte_pool *byte_pool)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_inband_mgmt_channel_multi_cfg *cfg; /* declare main API struct */
    bcmolt_inband_mgmt_channel_key key = {}; /* declare key */
    uint32_t max_msgs; /* declare max number of messages to get */
    bcmolt_filter_flags filter_flags = BCMOLT_FILTER_FLAGS_DISABLE_FILTER;

    apicli_print_start(session, "bcmolt_multi_cfg_get");

    /* Initialize key value to all wildcards. */
    BCMOLT_KEY_SET_TO_WILDCARD(&key);

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "id");
    if (cli_parm != NULL)
    {
        key.id = (bcmolt_inband_mgmt_instance_id)cli_parm->value.unumber;
    }

    /* Set max number of messages from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "max_msgs");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "max_msgs");
    }
    max_msgs = cli_parm->value.unumber;

    /* Set filter invert flag from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "filter_invert");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "filter_invert");
    }
    if (cli_parm->value.number)
    {
        filter_flags |= BCMOLT_FILTER_FLAGS_INVERT_SELECTION;
    }

    /* Initialize the API struct. */
    cfg = BCMOLT_MULTI_CFG_ALLOC(inband_mgmt_channel, key, max_msgs);
    if (cfg == NULL)
    {
        return apicli_err_alloc_fail(session);
    }
    byte_pool->multi_msg = &cfg->hdr.hdr;

    /* Decode API parameters from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "nni_intf");
    if (cli_parm != NULL)
    {
        bcmolt_flow_intf_ref nni_intf = {};
        bcmcli_cmd_parm *nni_intf_parm = cli_parm;
        cli_parm = apicli_find_struct_field(&nni_intf_parm->value, "intf_type");
        if (cli_parm != NULL)
        {
            bcmos_bool nni_intf_intf_type;
            nni_intf_intf_type = cli_parm->value.number;
            if (nni_intf_intf_type)
            {
                BCMOLT_FIELD_SET_PRESENT(&nni_intf, flow_intf_ref, intf_type);
            }
        }

        cli_parm = apicli_find_struct_field(&nni_intf_parm->value, "intf_id");
        if (cli_parm != NULL)
        {
            bcmos_bool nni_intf_intf_id;
            nni_intf_intf_id = cli_parm->value.number;
            if (nni_intf_intf_id)
            {
                BCMOLT_FIELD_SET_PRESENT(&nni_intf, flow_intf_ref, intf_id);
            }
        }

        BCMOLT_FIELD_SET(&cfg->request, inband_mgmt_channel_cfg_data, nni_intf, nni_intf);
    }

    cli_parm = bcmcli_find_named_parm(session, "policer_profile");
    if (cli_parm != NULL)
    {
        bcmos_bool policer_profile;
        policer_profile = cli_parm->value.number;
        if (policer_profile)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, policer_profile);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "nic_intf_id");
    if (cli_parm != NULL)
    {
        bcmos_bool nic_intf_id;
        nic_intf_id = cli_parm->value.number;
        if (nic_intf_id)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, nic_intf_id);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "vlan_id");
    if (cli_parm != NULL)
    {
        bcmos_bool vlan_id;
        vlan_id = cli_parm->value.number;
        if (vlan_id)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, vlan_id);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "nic_card_mac");
    if (cli_parm != NULL)
    {
        bcmos_bool nic_card_mac;
        nic_card_mac = cli_parm->value.number;
        if (nic_card_mac)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, nic_card_mac);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "action");
    if (cli_parm != NULL)
    {
        bcmos_bool action;
        action = cli_parm->value.number;
        if (action)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, action);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "state");
    if (cli_parm != NULL)
    {
        bcmos_bool state;
        state = cli_parm->value.number;
        if (state)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, inband_mgmt_channel_cfg_data, state);
        }
    }

    /* Decode filter fields from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "filter");
    if (cli_parm != NULL)
    {
        bcmolt_inband_mgmt_channel_cfg_data filter = {};
        bcmcli_cmd_parm *filter_parm = cli_parm;
        cli_parm = apicli_find_struct_field(&filter_parm->value, "nni_intf");
        if (cli_parm != NULL)
        {
            bcmolt_flow_intf_ref filter_nni_intf = {};
            bcmcli_cmd_parm *filter_nni_intf_parm = cli_parm;
            cli_parm = apicli_find_struct_field(&filter_nni_intf_parm->value, "intf_type");
            if (cli_parm != NULL)
            {
                bcmolt_flow_interface_type filter_nni_intf_intf_type;
                filter_nni_intf_intf_type = (bcmolt_flow_interface_type)cli_parm->value.enum_val;
                BCMOLT_FIELD_SET(&filter_nni_intf, flow_intf_ref, intf_type, filter_nni_intf_intf_type);
            }

            cli_parm = apicli_find_struct_field(&filter_nni_intf_parm->value, "intf_id");
            if (cli_parm != NULL)
            {
                bcmolt_interface_id filter_nni_intf_intf_id;
                filter_nni_intf_intf_id = (bcmolt_interface_id)cli_parm->value.unumber;
                BCMOLT_FIELD_SET(&filter_nni_intf, flow_intf_ref, intf_id, filter_nni_intf_intf_id);
            }

            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, nni_intf, filter_nni_intf);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "policer_profile");
        if (cli_parm != NULL)
        {
            bcmolt_policer_profile_id filter_policer_profile;
            filter_policer_profile = (bcmolt_policer_profile_id)cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, policer_profile, filter_policer_profile);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "nic_intf_id");
        if (cli_parm != NULL)
        {
            bcmolt_interface_id filter_nic_intf_id;
            filter_nic_intf_id = (bcmolt_interface_id)cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, nic_intf_id, filter_nic_intf_id);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "vlan_id");
        if (cli_parm != NULL)
        {
            uint16_t filter_vlan_id;
            filter_vlan_id = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, vlan_id, filter_vlan_id);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "nic_card_mac");
        if (cli_parm != NULL)
        {
            bcmos_mac_address filter_nic_card_mac;
            filter_nic_card_mac = cli_parm->value.mac;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, nic_card_mac, filter_nic_card_mac);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "action");
        if (cli_parm != NULL)
        {
            bcmolt_inband_mgmt_action_type filter_action;
            filter_action = (bcmolt_inband_mgmt_action_type)cli_parm->value.enum_val;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, action, filter_action);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "state");
        if (cli_parm != NULL)
        {
            bcmolt_inband_mgmt_state filter_state;
            filter_state = (bcmolt_inband_mgmt_state)cli_parm->value.enum_val;
            BCMOLT_FIELD_SET(&filter, inband_mgmt_channel_cfg_data, state, filter_state);
        }

        filter_flags &= ~BCMOLT_FILTER_FLAGS_DISABLE_FILTER;
        cfg->filter = filter;
    }

    /* Call API function. */
    cli_err = bcmolt_multi_cfg_get(device_id, &cfg->hdr, filter_flags);
    apicli_log_example_code(device_id, &cfg->hdr.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &cfg->hdr.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, cfg->hdr.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

