/** Executes the bcmolt_oper_submit API function ('send_eth_packet') for the "internal_nni" object
  * based on CLI input. */
static bcmos_errno bcmolt_cli_internal_nni_send_eth_packet_submit(
    bcmolt_devid device_id,
    bcmcli_session *session,
    apicli_byte_pool *byte_pool)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_internal_nni_send_eth_packet oper; /* declare main API struct */
    bcmolt_internal_nni_key key = {}; /* declare key */

    apicli_print_start(session, "bcmolt_oper_submit");

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "pon_ni");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "pon_ni");
    }
    else
    {
        key.pon_ni = (bcmolt_pon_ni)cli_parm->value.unumber;
    }

    /* Initialize the API struct. */
    BCMOLT_OPER_INIT(&oper, internal_nni, send_eth_packet, key);

    /* Decode API parameters from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "buffer");
    if (cli_parm != NULL)
    {
        bcmolt_bin_str buffer = {};
        buffer.len = bcmolt_buf_get_used(&cli_parm->value.buffer);
        buffer.arr = apicli_byte_pool_calloc(byte_pool, buffer.len);
        if (buffer.arr == NULL)
        {
            return apicli_err_alloc_fail(session);
        }
        bcmolt_buf_set_pos(&cli_parm->value.buffer, 0);
        bcmolt_buf_read(&cli_parm->value.buffer, buffer.arr, buffer.len);

        BCMOLT_FIELD_SET(&oper.data, internal_nni_send_eth_packet_data, buffer, buffer);
    }

    /* Call API function. */
    cli_err = bcmolt_oper_submit(device_id, &oper.hdr);
    apicli_log_example_code(device_id, &oper.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &oper.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, oper.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

