/** Executes the bcmolt_multi_cfg_get API function for the "log_file" object based on CLI input. */
static bcmos_errno bcmolt_cli_log_file_cfg_get_multi(
    bcmolt_devid device_id,
    bcmcli_session *session,
    apicli_byte_pool *byte_pool)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_log_file_multi_cfg *cfg; /* declare main API struct */
    bcmolt_log_file_key key = {}; /* declare key */
    uint32_t max_msgs; /* declare max number of messages to get */
    bcmolt_filter_flags filter_flags = BCMOLT_FILTER_FLAGS_DISABLE_FILTER;

    apicli_print_start(session, "bcmolt_multi_cfg_get");

    /* Initialize key value to all wildcards. */
    BCMOLT_KEY_SET_TO_WILDCARD(&key);

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "device_id");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "device_id");
    }
    else
    {
        key.device_id = (bcmolt_odid)cli_parm->value.unumber;
    }
    cli_parm = bcmcli_find_named_parm(session, "file_id");
    if (cli_parm != NULL)
    {
        key.file_id = (bcmolt_log_file_id)cli_parm->value.enum_val;
    }

    /* Set max number of messages from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "max_msgs");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "max_msgs");
    }
    max_msgs = cli_parm->value.unumber;

    /* Set filter invert flag from CLI parameter. */
    cli_parm = bcmcli_find_named_parm(session, "filter_invert");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "filter_invert");
    }
    if (cli_parm->value.number)
    {
        filter_flags |= BCMOLT_FILTER_FLAGS_INVERT_SELECTION;
    }

    /* Initialize the API struct. */
    cfg = BCMOLT_MULTI_CFG_ALLOC(log_file, key, max_msgs);
    if (cfg == NULL)
    {
        return apicli_err_alloc_fail(session);
    }
    byte_pool->multi_msg = &cfg->hdr.hdr;

    /* Decode API parameters from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "wrap_around");
    if (cli_parm != NULL)
    {
        bcmos_bool wrap_around;
        wrap_around = cli_parm->value.number;
        if (wrap_around)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, wrap_around);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "clear_after_read");
    if (cli_parm != NULL)
    {
        bcmos_bool clear_after_read;
        clear_after_read = cli_parm->value.number;
        if (clear_after_read)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, clear_after_read);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "msg_count");
    if (cli_parm != NULL)
    {
        bcmos_bool msg_count;
        msg_count = cli_parm->value.number;
        if (msg_count)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, msg_count);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "msgs_read");
    if (cli_parm != NULL)
    {
        bcmos_bool msgs_read;
        msgs_read = cli_parm->value.number;
        if (msgs_read)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, msgs_read);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "msgs_remaining");
    if (cli_parm != NULL)
    {
        bcmos_bool msgs_remaining;
        msgs_remaining = cli_parm->value.number;
        if (msgs_remaining)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, msgs_remaining);
        }
    }

    cli_parm = bcmcli_find_named_parm(session, "buffer");
    if (cli_parm != NULL)
    {
        bcmos_bool buffer;
        buffer = cli_parm->value.number;
        if (buffer)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, log_file_cfg_data, buffer);
        }
    }

    /* Decode filter fields from CLI. */
    cli_parm = bcmcli_find_named_parm(session, "filter");
    if (cli_parm != NULL)
    {
        bcmolt_log_file_cfg_data filter = {};
        bcmcli_cmd_parm *filter_parm = cli_parm;
        cli_parm = apicli_find_struct_field(&filter_parm->value, "wrap_around");
        if (cli_parm != NULL)
        {
            bcmos_bool filter_wrap_around;
            filter_wrap_around = cli_parm->value.number;
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, wrap_around, filter_wrap_around);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "clear_after_read");
        if (cli_parm != NULL)
        {
            bcmos_bool filter_clear_after_read;
            filter_clear_after_read = cli_parm->value.number;
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, clear_after_read, filter_clear_after_read);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "msg_count");
        if (cli_parm != NULL)
        {
            uint32_t filter_msg_count;
            filter_msg_count = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, msg_count, filter_msg_count);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "msgs_read");
        if (cli_parm != NULL)
        {
            uint32_t filter_msgs_read;
            filter_msgs_read = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, msgs_read, filter_msgs_read);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "msgs_remaining");
        if (cli_parm != NULL)
        {
            uint32_t filter_msgs_remaining;
            filter_msgs_remaining = cli_parm->value.unumber;
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, msgs_remaining, filter_msgs_remaining);
        }

        cli_parm = apicli_find_struct_field(&filter_parm->value, "buffer");
        if (cli_parm != NULL)
        {
            bcmolt_str_2048 filter_buffer = {};
            snprintf(filter_buffer.str, 2048, "%s", cli_parm->value.string);
            BCMOLT_FIELD_SET(&filter, log_file_cfg_data, buffer, filter_buffer);
        }

        filter_flags &= ~BCMOLT_FILTER_FLAGS_DISABLE_FILTER;
        cfg->filter = filter;
    }

    /* Call API function. */
    cli_err = bcmolt_multi_cfg_get(device_id, &cfg->hdr, filter_flags);
    apicli_log_example_code(device_id, &cfg->hdr.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &cfg->hdr.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, cfg->hdr.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

