/** Executes the bcmolt_cfg_clear API function for the "pon_interface" object based on CLI input. */
static bcmos_errno bcmolt_cli_pon_interface_cfg_clear(
    bcmolt_devid device_id,
    bcmcli_session *session)
{
    bcmcli_cmd_parm *cli_parm;
    bcmos_errno cli_err;
    bcmolt_pon_interface_cfg cfg; /* declare main API struct */
    bcmolt_pon_interface_key key = {}; /* declare key */

    apicli_print_start(session, "bcmolt_cfg_clear");

    /* Build key from CLI parameters. */
    cli_parm = bcmcli_find_named_parm(session, "pon_ni");
    if (cli_parm == NULL)
    {
        return apicli_err_param_not_set(session, "pon_ni");
    }
    else
    {
        key.pon_ni = (bcmolt_pon_ni)cli_parm->value.unumber;
    }

    /* Initialize the API struct. */
    BCMOLT_CFG_INIT(&cfg, pon_interface, key);

    /* Call API function. */
    cli_err = bcmolt_cfg_clear(device_id, &cfg.hdr);
    apicli_log_example_code(device_id, &cfg.hdr.hdr);

    if (cli_err == BCM_ERR_OK)
    {
        /* Print API contents to the CLI. */
        apicli_print_data_start(session);
        cli_err = apicli_msg_dump(session, device_id, &cfg.hdr.hdr);
    }

    apicli_print_complete(session, cli_err, cfg.hdr.hdr.err_text);
    return BCM_ERR_OK;
}

