    bcmolt_tm_qmp_key key = {}; /* declare key */
    uint32_t max_msgs; /* declare max number of messages to get */
    bcmolt_filter_flags filter_flags = BCMOLT_FILTER_FLAGS_DISABLE_FILTER;

    apicli_print_start(session, "bcmolt_multi_cfg_get");

    /* Initialize key value to all wildcards. */
    BCMOLT_KEY_SET_TO_WILDCARD(&key);

