    if (cli_parm != NULL)
    {
        bcmos_bool state;
        state = cli_parm->value.number;
        if (state)
        {
            BCMOLT_FIELD_SET_PRESENT(&cfg->request, tm_qmp_cfg_data, state);
        }
    }

